description:
In 1963, Roll Over Beethoven was released as a EP in France by Odeon. The cover photo from their fourth French EP Roll Over Beethoven was taken at a concert at Olympia De Paris. It was the first cover the feature the name &quot;Les Beatles&quot;, and would appear on every album after it.

Track Listing [320k MP3]

    1. &quot;Roll Over Beethoven&quot;
    2. &quot;You Really Gotta Hold on Me&quot;
    3. &quot;Boys&quot;
    4. &quot;Love Me Do&quot;
